import { useEffect } from 'react';
import { io } from 'socket.io-client';

const socket = io("http://localhost:5000");

function App() {
  useEffect(() => {
    socket.on("message", (msg) => {
      console.log("New message:", msg);
    });
  }, []);

  return (
    <div>
      <button onClick={() => socket.emit("message", "Hello!")}>
        Send Test Message
      </button>
    </div>
  );
}

export default App;
